import React from "react";
import "./Convo.css";
function Convo({ name, message, timestamp, profilePic }) {
  return (
    <div className="Convo">
      <img
        src={profilePic}
        alt={name}
        style={{
          width: "100px",
          height: "90px",
          objectFit: "contain",
          borderRadius: "50px",
        }}
      />
      <div className="Convo__details">
        <h4>{name}</h4>
        <p>{message}</p>
      </div>
      <p>{timestamp}</p>
    </div>
  );
}

export default Convo;
